    [],nt"revision_timestamp": "2016-07-27T23:02:33.830977",nt"name": "kodiak-island-bald-eagle-migration-and-movements-study-progress-report-update-b4ad1",nt"isopen":
    false,nt"url": null,nt"notes": "The purpose of this report is to update
    the progress of the bald eagle migration and movements study begun during July of
    1982. The study objectives are: to determine and compare seasonal movement patterns
    of sub-adult and adult bald eagles on Kodiak Island; to identify possible emigration
    and immigration patterns between the Kodiak population of bald eagles and other
    Alaskan or North Pacific bald eagle populations; and to document local winter movements
    in relation to the Kodiak state airport in an effort to minimize bird strike hazards
    winter bald eagles have posed in that area in past years. Study methods and results
    and discussion are covered, and study maps and data forms are attached.",nt"license_title":
